import React from 'react';
import { Paper, Grid } from '@material-ui/core';
import { Link } from 'react-router-dom';

export default (props) => {
  //console.log(props);
  return (
    <Grid container>
      <Grid item sm>
        <Paper >
          Left Pane
          <br/>
          {
            props.types.map(({id, name, material}) =>
            <Link key={id} to="">{name} - {material}<br/></Link>
            )
          }
          </Paper>
        </Grid>
      </Grid>
  );
}
